func (l *TypeScriptLexer) Action(localctx antlr.RuleContext, ruleIndex, actionIndex int) {
	switch ruleIndex {
	case 7:
		l.OpenBrace_Action(localctx, actionIndex)

	case 8:
		l.CloseBrace_Action(localctx, actionIndex)

	case 123:
		l.StringLiteral_Action(localctx, actionIndex)

	default:
		panic("No registered action for: " + fmt.Sprint(ruleIndex))
	}
}

